Web3 Library will explore the following areas.

1. Knowledge curation

Curators create themes, such as Public Goods. They write summary for the selected articles, and then set tags to present the subject of the knowledge list clearly and distinctly, which is a curation of knowledge.

While the content continues to accumulate, we work with SeeDAO Product Guild to build an ever-expanding, endless knowledge graph and relationship network based on its information aggregation project by linking knowledge points, knowledge lists, and related article authors, NFT collectors, and readers through tags, titles, summaries, and topics.


2. Visual presentation of Web3 Library

The public library in Metaverse.

In the Web3 era, we can recreate visual 「buildings」 in the Metaverse's land projects.

Borges once said: If there is a heaven, it should look like a library. He also designed this heavenly library in his imagination himself, using hexagons as the basic element. He tried to build an endlessly linked library with hexagons, symbolizing the endless links of knowledge and the endless possibilities of imagination.

We will reproduce Library of Babel in Metaverse.


3. Organizational Governance

Operating as a DAO.

In the Web3 era, DAO-based organizational relationships allow for full disclosure of builder status to the entire community for participation as well. And what makes this participation possible is a healthy incentive system.

The library's internal incentive system, which currently uses a POAP system, using POAP to record workloads for future retroactive rewards.


4. Experimental exploration

Through the Web3 Library, which is a public goods project, we are exploring avenues on how to achieve a sustainable incentive model for public goods.



Roadmap:

2022 Q2

1> Release Web3 library MVP with Public Goods topic;

2> Release official website;

3> Decentralized editor committee;

4> Participate in SeeDAO Hackathon;


2022 Q3

1> Governance mechanism and token economics;

2> Other DAOs and communities can add topics in Web3 library;

3> Design public library in Wonderland Metaverse;

(Paradise will be a kind of library, The Library of Babel)


2022 Q4

1> Web3lib DAO;

2> Building The Library of Babel in Wonderland Metaverse;


2023

1> Add all Web3 related topics in Web3 library;

2> Build The Library of Babel in different Metaverse projects;
